import React, { Component } from "react";
import { TextField, Container, Button } from "@material-ui/core";

class Register extends Component {
  render() {
    return (
      <div>
        <h3>REGISTER</h3>
        <Container>
          <TextField
            style={{ width: 500 }}
            label="Email"
            margin="dense"
            variant="outlined"
          />
          <br />
          <TextField
            style={{ width: 500 }}
            label="Email"
            margin="dense"
            variant="outlined"
          />
          <br />
          <TextField
            style={{ width: 500 }}
            label="Passworld"
            margin="dense"
            variant="outlined"
            type="password"
            id="standard-dense"
          />
          <br />
          <Button
            onClick={() => {
              console.log("AA");
            }}
            style={{
              width: 500,
              marginTop: 50,
              background: "yellow",
              color: "black"
            }}
          >
            REGISTER
          </Button>
        </Container>
      </div>
    );
  }
}

export default Register;
